import React, { Component } from 'react';
import "../welcome/Count.css";
import { Link  } from "react-router-dom";
import subbanner from "../images/sub-banner.jpg";
import slick2 from "../images/slick/slick2.jpg";
import CountDown from '../welcome/CountDown';

function Count() {
    return (
         <section className='container'>
             <div className='site-content'>
                 <div className='posts'>
                     <div className='post-images'>
                         <div>
                             <img src= {subbanner} className='subbanner' alt=''></img>

                         </div>
                     </div>
                 </div>

                 <aside class="sidebar">
                    <div class="popular-post">

                        <h2 className='sub'>Countdown to Cute</h2>
                        <CountDown/>
                        <div class="post-content" data-aos="flip-up" data-aos-delay="200">



                        </div>
                    </div>

                    </aside>
             </div>
         </section>
    );
}

export default Count;
